import React from 'react';
import { Link } from 'react-router-dom';
import SearchBar from '../SearchBar/SearchBar.js';
import * as S from './NavBar.styled.js'

export default function NavBar() {

  return (
    <S.Div >

      <SearchBar/>

      <S.Buttons > 
        <Link to='/recipe/create'>
          <S.CreateButton>
            CREAR
          </S.CreateButton>
        </Link >

        <Link to='/'>
          <S.HomeButton>
            HOME
          </S.HomeButton>
        </Link >
      </S.Buttons>
    </S.Div>
  )
};
